static const uint8_t JMSBB[] = {
    1,
    0xD4
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMSBData(char *Buffer)
{
    memcpy(Buffer, &JMSBL0[1], JMSBL0[0] << 2);
    Buffer += (JMSBL0[0] << 2);

    memcpy(Buffer, &JMSBL1[1], JMSBL1[0] << 2);
    Buffer += (JMSBL1[0] << 2);

    memcpy(Buffer, &JMSBL2[1], JMSBL2[0] << 2);
    Buffer += (JMSBL2[0] << 2);

    memcpy(Buffer, &JMSBL3[1], JMSBL3[0] << 2);
    Buffer += (JMSBL3[0] << 2);

    memcpy(Buffer, &JMSBL4[1], JMSBL4[0] << 2);
    Buffer += (JMSBL4[0] << 2);

    memcpy(Buffer, &JMSBB[1], JMSBB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMSBName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMSBData(void)
{
    remove(JMSBName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMSBData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMSBName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMSBName)) return "";
    #endif

    if (!(han = fopen(JMSBName, "wb"))) return "";
    if (AutoClean) atexit(KillJMSBData);

    num = fwrite(&JMSBL0[1], 4, JMSBL0[0], han);
    if (num != JMSBL0[0]) {fclose(han); return "";}

    num = fwrite(&JMSBL1[1], 4, JMSBL1[0], han);
    if (num != JMSBL1[0]) {fclose(han); return "";}

    num = fwrite(&JMSBL2[1], 4, JMSBL2[0], han);
    if (num != JMSBL2[0]) {fclose(han); return "";}

    num = fwrite(&JMSBL3[1], 4, JMSBL3[0], han);
    if (num != JMSBL3[0]) {fclose(han); return "";}

    num = fwrite(&JMSBL4[1], 4, JMSBL4[0], han);
    if (num != JMSBL4[0]) {fclose(han); return "";}

    num = fwrite(&JMSBB[1], 1, JMSBB[0], han);
    if (num != JMSBB[0]) {fclose(han); return "";}

    fclose(han);
    return JMSBName;
}

